def flatten_nested_list(nested_list):
    flattened_list = []

    def flatten_list(lst):
        for item in lst:
            if isinstance(item, list):
                flatten_list(item)
            else:
                flattened_list.append(item)

    flatten_list(nested_list)
    return flattened_list

